LIZA B 
Age: 25
Eyecolor: GREEN
Haircolor: BLOND
Height: 175 cm
Weight: 53 kg
Breast Size: Medium
Measurements: 88/60/90
Country: Ukraine
Ethnicity: Caucasian
Bio: I like to go to big parties and to dance, I love the sea and to travel. My dream is to open a hotel in Bora Bora,  in French Polynesia!

----------------

SHARON E 
Age: 29
Eyecolor: GREEN
Haircolor: BROWN
Height: 174 cm
Weight: 52 kg
Breast Size: Small
Measurements: 90/62/92
Country: Ukraine
Ethnicity: Caucasian
Bio: I like to dance and I like creative activities, in particular photography 
and the arts in general. One of my biggest weaknesses is traveling to exotic places. I like resting in the sun and slowly drink chilly fresh watermelon juice. When I come back, I like to give souvenirs to my friends.

